import React from "react";
import { NativeBaseProvider } from "native-base";
import {
  Banner,
  IconContainer,
  InnerContainer,
  StyledButton,
  StyledContainer,
  BannerLogo,
  BannerTitle,
} from "../components/styles";
import { SafeAreaView, StatusBar, View } from "react-native";
import { ButtonText } from "./../components/styles";
import { Octicons, FontAwesome5 } from "@expo/vector-icons";
import { Colors, PageTitle } from "../components/styles";

import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator } from "@react-navigation/drawer";
import Login from "./Login";

const { primary, brand, tertiary } = Colors;

const Homepage = ({ navigation }) => {
  return (
    <NativeBaseProvider>
      <StyledContainer>
        <StatusBar style="dark" />
        <InnerContainer>
          <Banner>
            <BannerLogo
              resizeMode="cover"
              source={require("./../assets/img/page_logo.png")}
            />
            <BannerTitle
              resizeMode="cover"
              source={require("./../assets/img/page_title.png")}
            />
          </Banner>
          <StyledButton
            iconButton={true}
            onPress={() => navigation.navigate("MyInformation")}
          >
            <RoundedIcon
              icon="credit-card"
              backgroundColor="#6d4c41"
            ></RoundedIcon>
            <ButtonText iconButton={true}>My Information</ButtonText>
          </StyledButton>
          <StyledButton iconButton={true}>
            <RoundedIcon
              icon="database"
              backgroundColor="#ff6f00"
            ></RoundedIcon>
            <ButtonText iconButton={true}>My Contribution</ButtonText>
          </StyledButton>
          <StyledButton
            iconButton={true}
            onPress={() => navigation.navigate("MyPackages")}
          >
            <RoundedIcon
              icon="briefcase"
              backgroundColor="#6a1b9a"
            ></RoundedIcon>
            <ButtonText iconButton={true}>DeathCare Packages</ButtonText>
          </StyledButton>
          <StyledButton
            iconButton={true}
            onPress={() => navigation.navigate("MyAccount")}
          >
            <RoundedIcon icon="person" backgroundColor="#ad1457"></RoundedIcon>
            <ButtonText iconButton={true}>Manage Account</ButtonText>
          </StyledButton>
        </InnerContainer>
      </StyledContainer>
    </NativeBaseProvider>
  );
};

const RoundedIcon = ({ backgroundColor, icon, ...props }) => {
  return (
    <IconContainer backgroundColor={backgroundColor}>
      <Octicons name={icon} size={40} color={primary} />
    </IconContainer>
  );
};

export default Homepage;
